body:
When COSE was first designed CDDL was still incomplete, and so the COSE RFC expresses the content of binary blobs that contain CDDL using a comment - with "comments" that live inside the comment set off by backslashes [eg](https://github.com/cose-wg/cose-rfc8152bis/blob/08ac00ae1a3a0722fc2ff894455967bf04df8683/draft-ietf-cose-rfc8152bis-struct.xml#L2227):

    / protected / h'a10101' / {
        \ alg \ 1:1 \ AES-GCM 128 \
      } / , 

CDDL's Extended Diagnostic Notation now defines a clean way to handle this situation, using double angle brackets; the above can now be expressed as:

    / protected / << {
        / alg / 1:1 / AES-GCM 128 /
    } >> ,

which is easier to read and communicates the intent more clearly.
